var index = null;
var moduleTitle = null;
var moduleIndex;
window.onload = function () {
    var url = document.location.href,
        params = url.split('?')[1].split('&'),
        data = {}, tmp;
    for (var i = 0, l = params.length; i < l; i++) {
        tmp = params[i].split('=');
        data[tmp[0]] = tmp[1];
    }
    title = data.name.split("%20").join(" ");
    this.moduleTitle = title.split("%23")[0];
    this.index = title.split("%23")[1];
    document.getElementById('title').innerHTML = this.moduleTitle;
    console.log("Index :" + this.index);

    getMedia();


}



function getMedia() {

    var module = dir_tree['children'][index]['children'];

    moduleIndex = dir_tree['children'][index]['children'].findIndex(function (person) {

        return person.name == moduleTitle;
    });



    var mediaTree = module[moduleIndex]['children'];

    var mediaEle = document.getElementById("mediaList");

    var rawMedia = [];
    for (i = 0; i < mediaTree.length; i++) {

        media = mediaTree[i].name;
        if (mediaTree[i].type == "file") {

            check = media.slice(-4);

            if (check == ".mp4") {


                rawMedia.push(media);



            }

        }
    }

    rawMedia.sort((a, b) => a.split(".")[0] - b.split(".")[0]);
    for (i = 0; i < rawMedia.length; i++) {
        var node = document.createElement("LI");
        node.className = "mediali";
        node.className = "list-group-item";
        var textnode = document.createTextNode(rawMedia[i].slice(0, -4));
        node.appendChild(textnode);
        mediaEle.append(node)
    }


}


var ul = document.getElementById('mediaList');
var heaEle = document.getElementById('mediaTitle');

ul.onclick = function (event) {

    var name = event.target.innerHTML;
    heaEle.innerHTML = name;
    var mediaPlayer = document.getElementById('mediaPlayer');
    var media_src = "courses\\/" + dir_tree['children'][index].name + "\\/" + dir_tree['children'][index]['children'][moduleIndex].name + "\\/" + name + ".mp4";
    console.log(media_src);
    mediaPlayer.src = media_src;
};

